INSERT INTO tx_route_marker VALUES ('3', '%pid%', '1378126209', '1368013394', '1', '0', '0', 'Berliner Reichstagsgebäude', 'Das Reichstagsgebäude (kurz Reichstag; offiziell Plenarbereich Reichstagsgebäude) am Platz der Republik in Berlin ist seit 1999 Sitz des Deutschen Bundestages. Die Bundesversammlung tritt hier seit 1994 zur Wahl des deutschen Bundespräsidenten zusammen.', '<h2>Wissenswertes</h2>\r\n<h3>Ausrufung der Republik</h3>\r\nVom zweiten Westbalkon links neben dem Hauptportal rief am Nachmittag des 9. November 1918 der SPD-Fraktionsvorsitzende Philipp Scheidemann die „Deutsche Republik“ aus. An dieser Stelle ist heute eine Gedenktafel angebracht. Scheidemanns Rede ist in unterschiedlichen Versionen überliefert. 1928 zitierte er sich selbst in seinen Memoiren:\r\n<div class="indent">“Arbeiter und Soldaten! Furchtbar waren die vier Kriegsjahre. Grauenhaft waren die Opfer, die das Volk an Gut und Blut hat bringen müssen. Der unglückselige Krieg ist zu Ende. Das Morden ist vorbei. Die Folgen des Kriegs, Not und Elend werden noch viele Jahre lang auf uns lasten. Seid einig, treu und pflichtbewusst! Das Alte und Morsche, die Monarchie, ist zusammengebrochen. Es lebe das Neue! Es lebe die Deutsche Republik!“</div>\r\nEinige Stunden später proklamierte Karl Liebknecht vom Berliner Stadtschloss aus die „Freie Sozialistische Republik“ (Räterepublik).\r\n<h3>Blutbad vor dem Reichstag</h3>\r\nEin Versuch der USPD und der KPD, notleidende Berliner Arbeitermassen für einen neuen Anlauf zur Errichtung einer Räteherrschaft zu mobilisieren, endete am 13. Januar 1920 in dem Blutbad am Reichstagsgebäude.<br />Hitler und das Reichstagsgebäude<br /><br />Entgegen einer weitverbreiteten Meinung hielt Adolf Hitler niemals eine Rede im Reichstagsgebäude. Hitler, der während der Weimarer Republik selbst nie Reichstagsabgeordneter war, wurde am 30. Januar 1933 vom Reichspräsidenten von Hindenburg zum Reichskanzler bestimmt. Bereits zwei Tage später wurde der 7. Reichstag vom Reichspräsidenten aufgelöst. Die konstituierende Sitzung des neuen Parlaments am 21. März 1933 (Tag von Potsdam) fand bereits nach dem Reichstagsbrand statt. Der Reichskanzler Adolf Hitler hielt seine Reichstagsreden in der zum Parlamentsgebäude umfunktionierten Krolloper.\r\n<h3>Unterirdischer Gang</h3>\r\nBei den Umbaumaßnahmen nach der Wiedervereinigung wurde ein Gang mit Heizungsrohren entdeckt. Er verband einst das Reichstagsgebäude mit dem Reichstagspräsidentenpalais, das heute Sitz der Deutschen Parlamentarischen Gesellschaft ist. Ein Teil des Heizungsganges ist während der Umbauarbeiten herausgetrennt worden und steht nun als isoliertes Objekt in der Fußgängerunterführung vom Reichstag zum Jakob-Kaiser-Haus.<br />Rückseite des Bundesadlers, gestaltet von Norman Foster<br />Bundesadler<br /><br />In zahlreichen Entwürfen schlug Norman Foster neue Lösungen für die Gestaltung des Bundesadlers im Plenarsaal vor, den er sich vor allem schlanker wünschte. Die Abgeordneten entschieden sich jedoch für eine vergrößerte Kopie der rundlichen Form, die der Bildhauer Ludwig Gies einst für das Bonner Parlament entworfen hatte (ironische Bezeichnung: „Fette Henne“). Foster übernahm es aber, die Rückseite des Adlers zu gestalten – dieser hängt in Berlin vor einer Glaswand, ist also erstmals von beiden Seiten zu sehen. Der neue Adler, von Foster auf der Rückseite signiert, ist mit 58 m² um etwa ein Drittel größer als der alte und wiegt 2,5 Tonnen.<br />Reichstag bei Nacht\r\n<h3>Fahne der Einheit</h3>\r\nIn der Nacht vom 2. zum 3. Oktober 1990 um Mitternacht wurde anlässlich der Deutschen Einheit auf dem Platz der Republik die „Fahne der Einheit“ gehisst, die bis heute Tag und Nacht weht (nachts wird sie angestrahlt) und sechs mal zehn Meter misst.\r\n<h2>Quelle</h2>\r\n<ul><li>Der Text stammt von Wikipedia (siehe Link unten)</li></ul>', 'Reichstag_Kuppel.jpg,Reichstag_Berlin.jpg,Reichstag_int_1906.jpg', 'Reichstagskuppel\r\nBerliner Reichstag (heute)\r\nPlenarsitzung im Jahr 1906', 'Reichstagskuppel | Foto: Immanuel Giel, wikimedia.org\r\nBerliner Reichstag | Foto: Jürgen Matern, wikimedia.org\r\nPlenarsitzung im Jahr 1960 | Foto: unbekannt', '200c', '', '2', '3', '0', '', '', '1', '0', '0', '0', '0', '52.5189368', '13.3755112', 'http://de.wikipedia.org/wiki/Reichstagsgebäude', '1', '', '', '', '', '', '', '0', '0', '', '0', '0', 'a:44:{s:5:"title";N;s:5:"short";N;s:8:"bodytext";N;s:17:"tx_route_category";N;s:7:"address";N;s:11:"addressname";N;s:6:"street";N;s:3:"zip";N;s:4:"city";N;s:10:"areaLevel2";N;s:10:"areaLevel1";N;s:7:"country";N;s:15:"geoupdateprompt";N;s:18:"geoupdateforbidden";N;s:3:"lon";N;s:3:"lat";N;s:5:"phone";N;s:3:"fax";N;s:5:"email";N;s:3:"url";N;s:13:"tx_route_path";N;s:10:"list_title";N;s:10:"list_short";N;s:9:"map_title";N;s:9:"map_short";N;s:5:"image";N;s:12:"imagecaption";N;s:8:"imageseo";N;s:11:"imageorient";N;s:9:"imagecols";N;s:12:"image_noRows";N;s:21:"imagecaption_position";N;s:10:"image_zoom";N;s:10:"image_link";N;s:10:"imagewidth";N;s:11:"imageheight";N;s:11:"imageborder";N;s:17:"image_compression";N;s:13:"image_effects";N;s:12:"image_frames";N;s:6:"hidden";N;s:9:"starttime";N;s:7:"endtime";N;s:8:"fe_group";N;}', '2', NULL, NULL, 'Platz der Republik 1', '11011', 'Berlin', NULL, '* 2013-09-02 14:50:09 - Browsers - TYPO3 ohne PHP:\n  Breiten- und Längengrad wurden aktualisiert!\n13.376210,52.518572', '0', '++49 30 2273 2152', NULL, NULL, 'Berliner Reichstagsgebäude');
INSERT INTO tx_route_marker VALUES ('4', '%pid%', '1378153144', '1368013623', '1', '0', '0', 'Brandenburger Tor', 'Das Brandenburger Tor in Berlin steht am Pariser Platz in der Dorotheenstadt im Ortsteil Mitte (Bezirk Mitte). Es wurde in den Jahren von 1788 bis 1791 auf Anweisung des preußischen Königs Friedrich Wilhelm II. von Carl Gotthard Langhans errichtet und ist ein bekanntes Wahrzeichen und nationales Symbol, mit dem viele wichtige Ereignisse der Geschichte Berlins, Deutschlands, Europas und der Welt des 20. Jahrhunderts verbunden sind. Der Bau ist dem frühklassizistischen Stil zuzuordnen.\r\nDas Brandenburger Tor bildet mit dem Pariser Platz den Abschluss der Straße Unter den Linden. Auf der Westseite des Tores liegt der Platz des 18. März, an dem die Straße des 17. Juni beginnt, die den Tiergarten durchquert.\r\nDas Brandenburger Tor markierte die Grenze zwischen Ost- und West-Berlin und damit die Grenze zwischen den Staaten des Warschauer Paktes und der NATO. Es war bis zur Wiedervereinigung Deutschlands Symbol des Kalten Krieges und wurde nach 1990 zum Symbol der Wiedervereinigung Deutschlands und Europas.', '<h2>Ende der Kaiserzeit und Weimarer Republik</h2>\r\nBis zur Abdankung Kaiser Wilhelms II. im Jahr 1918 durften nur Mitglieder der kaiserlichen Familie, deren persönliche Gäste sowie – in Erinnerung an General Ernst von Pfuel, den Kommandanten des preußischen Sektors von Paris nach dem Sieg über Napoleon – die Pfuels die mittlere Durchfahrt benutzen.\r\n<h2>Nationalsozialismus und Zweiter Weltkrieg</h2>\r\nIm Rahmen der Umgestaltung Berlins zur sogenannten „Welthauptstadt Germania“ befand sich das Tor auf der Ost-West-Achse. Ein sieben Kilometer langer Abschnitt zwischen Brandenburger Tor und Adolf-Hitler-Platz (heute: Theodor-Heuss-Platz) wurde ausgebaut und 1939 in Betrieb genommen. Beim weiteren Ausbau der Ost-West-Achse, zu dem es nicht mehr gekommen ist, sollten unter anderem die seitlichen Säulenhallen vom Brandenburger Tor abgerückt werden. Der Verkehr wäre dann nicht mehr nur durch, sondern auch um das Tor herum geführt worden.<br /><br />Während des Zweiten Weltkriegs wurde von der Quadriga 1942 ein Gipsabguss genommen. Bei den Kämpfen um Berlin wurde die Quadriga mehrfach stark beschädigt. Lediglich ein Pferdekopf blieb vom Schadow\'schen Original erhalten, der heute im Berliner Märkischen Museum ausgestellt ist. Auch das Gebäude selbst wurde beschädigt, eine Säule zerschossen.\r\n<h2>Wiederaufbau und Rekonstruktion der Quadriga nach dem Krieg</h2>\r\nAm 21. September 1956 wurde vom Ost-Berliner Magistrat beschlossen, das einzige erhaltene ehemalige Stadttor wieder aufzubauen. Trotz heftiger Auseinandersetzungen und gegenseitiger Vorwürfe arbeiteten beide Teile Berlins bei der Wiederherstellung zusammen. Die Quadriga musste aufgrund der Kriegsschäden vollständig neugeschaffen werden, die Rekonstruktion besorgte der Bildhauer Otto Schnitzer, die Ausführung übernahm die traditionsreiche Gießerei Hermann Noack, damals noch in Friedenau. Am 14. Dezember 1957 war der Wiederaufbau beendet.<br /><br />In der Nacht vom 2. auf den 3. August 1958 wurde die Quadriga heimlich in den Neuen Marstall verbracht und der Preußenadler sowie das Eiserne Kreuz entfernt bzw. herausgelötet. Die Ost-Berliner Stadtverordnetenversammlung erklärte hierzu die „Embleme des preußisch-deutschen Militarismus“ dürften nicht mehr zur Aufstellung gelangen.\r\n<h2>Quelle</h2>\r\n<ul><li>Der Text stammt von Wikipedia (siehe Link unten)</li></ul>', 'Brandenburger_Tor_abends.jpg', 'Brandenburger Tor', 'Brandenburger Tor | Foto: Thomas Wolf, www.foto-tw.de', '', '200', '17', '1', '0', '', '', '1', '0', '0', '0', '0', '52.5168559', '13.379365', 'http://de.wikipedia.org/wiki/Brandenburger_Tor - - "Brandenburger Tor mit TYPO3 Route"', '2', '', '', '', '', '', '', '0', '0', '', '0', '0', 'a:43:{s:5:"title";N;s:5:"short";N;s:8:"bodytext";N;s:17:"tx_route_category";N;s:11:"addressname";N;s:6:"street";N;s:3:"zip";N;s:4:"city";N;s:10:"areaLevel2";N;s:10:"areaLevel1";N;s:7:"country";N;s:15:"geoupdateprompt";N;s:18:"geoupdateforbidden";N;s:3:"lon";N;s:3:"lat";N;s:5:"phone";N;s:3:"fax";N;s:5:"email";N;s:3:"url";N;s:13:"tx_route_path";N;s:10:"list_title";N;s:10:"list_short";N;s:9:"map_title";N;s:9:"map_short";N;s:5:"image";N;s:12:"imagecaption";N;s:8:"imageseo";N;s:11:"imageorient";N;s:9:"imagecols";N;s:12:"image_noRows";N;s:21:"imagecaption_position";N;s:10:"image_zoom";N;s:10:"image_link";N;s:10:"imagewidth";N;s:11:"imageheight";N;s:11:"imageborder";N;s:17:"image_compression";N;s:13:"image_effects";N;s:12:"image_frames";N;s:6:"hidden";N;s:9:"starttime";N;s:7:"endtime";N;s:8:"fe_group";N;}', '1', 'Berlin', 'Mitte', 'Pariser Platz', '10117', 'Berlin', 'Deutschland', '* 2013-09-02 22:19:09 - Browser - TYPO3 without PHP:\n  latitude and longitude are updated!\n* 2013-09-02 22:18:57 - Browser - TYPO3 without PHP:\r\n  latitude and longitude are updated!\r\n* 2013-09-02 14:54:03 - Browsers - TYPO3 ohne PHP:\r\n  Breiten- und Längengrad wurden aktualisiert!\r\n', '0', '', '', '', 'Brandenburger Tor');
INSERT INTO tx_route_marker VALUES ('5', '%pid%', '1378127293', '1368015563', '1', '0', '0', 'Holocaust-Mahnmal – Denkmal für die ermordeten Juden Europas', 'Das Denkmal für die ermordeten Juden Europas, kurz Holocaust-Mahnmal genannt, ist ein Mahnmal für die unter der Herrschaft der Nationalsozialisten im Holocaust ermordeten Juden. Zwischen 2003 und Frühjahr 2005 wurde das Bauwerk in der historischen Mitte Berlins auf einer etwa 19.000 m² großen Fläche in der Nähe des Brandenburger Tors errichtet. Der Entwurf stammt von Peter Eisenman. Das Mahnmal wurde am 10. Mai 2005 feierlich eingeweiht und ist seit dem 12. Mai 2005 der Öffentlichkeit zugänglich. Im ersten Jahr kamen über 3,5 Millionen Besucher. Das Denkmal wird von der Stiftung Denkmal für die ermordeten Juden Europas, die im Jahr 2000 gegründet wurde, betreut. Zwischen 2003 und 2005 war die Stiftung auch der Bauherr des Denkmals.', '<h2>Aufbau</h2>\r\nAuf der gewellten Grundfläche wurden 2711 zwischen 0,5° und 2° geneigte Betonquader (Stelen) in parallelen Reihen aufgestellt (54 Nord-Süd- und 87 Ost-West-Achsen). Bei identischem Grundriss (2,38 m × 0,95 m) weisen die Stelen unterschiedliche Höhen auf, zwischen ebenerdig (112 Stück im Gehweg) und 4,7 Meter. Von den nicht-ebenerdigen Stelen sind 367 niedriger als ein Meter, 869 haben Höhen von ein bis zwei Metern, 491 Stelen sind zwischen zwei und drei Metern hoch, 569 Stelen haben eine Höhe zwischen drei und vier Metern und 303 sind größer als vier Meter. Die schwerste wiegt etwa 16 Tonnen. Innen sind die Stelen hohl, wobei die Wandstärke rund 15 cm beträgt. Am Rand des Stelenfeldes befinden sich 41 Bäume. Die gepflasterte 13.100 m² große Bodenfläche führt unter das Niveau der umgebenden Straßen. Die gleichmäßig 95 Zentimeter breiten Gänge zwischen den Stelen sind für die Besucher voll begehbar, bieten allerdings nicht genügend Platz, um zu zweit nebeneinanderzugehen.\r\nIn einem mehrstufigen Verfahren sind die Stelen speziell oberflächenbehandelt, um eine einfache Entfernung von Graffiti zu gewährleisten. Die Zahl von 2711 Stelen hat nach Auskunft der Denkmalstiftung keine symbolische Bedeutung, sondern ergibt sich aus den Maßen, die der Architekt für diesen Standort wählte.\r\nEin unterirdisches, 930 m² großes Museum (Ort der Information) ergänzt den Komplex. Es enthält unter anderem eine Liste aller Namen der bekannten jüdischen Holocaustopfer. Es besteht aus Ausstellungsräumen (778 m²), Vortragsräumen (106 m²) und einem Buchladen (46 m²).\r\n<h2>Quelle</h2>\r\n<ul><li>Der Text stammt von Wikipedia (siehe Link unten)</li></ul>', 'Holocaust-Mahnmal_Berlin.jpg', 'Holocaust-Mahnmal', 'Holocaust-Mahnmal | Foto: K. Weisser, wikipedia', '240', '', '26', '1', '0', '', '', '1', '0', '0', '0', '0', '52.5139165', '13.3772362', 'http://de.wikipedia.org/wiki/Denkmal_f%C3%BCr_die_ermordeten_Juden_Europas', '1', '', '', '', '', '', '', '0', '0', '', '0', '0', 'a:44:{s:5:"title";N;s:5:"short";N;s:8:"bodytext";N;s:17:"tx_route_category";N;s:7:"address";N;s:11:"addressname";N;s:6:"street";N;s:3:"zip";N;s:4:"city";N;s:10:"areaLevel2";N;s:10:"areaLevel1";N;s:7:"country";N;s:15:"geoupdateprompt";N;s:18:"geoupdateforbidden";N;s:3:"lon";N;s:3:"lat";N;s:5:"phone";N;s:3:"fax";N;s:5:"email";N;s:3:"url";N;s:13:"tx_route_path";N;s:10:"list_title";N;s:10:"list_short";N;s:9:"map_title";N;s:9:"map_short";N;s:5:"image";N;s:12:"imagecaption";N;s:8:"imageseo";N;s:11:"imageorient";N;s:9:"imagecols";N;s:12:"image_noRows";N;s:21:"imagecaption_position";N;s:10:"image_zoom";N;s:10:"image_link";N;s:10:"imagewidth";N;s:11:"imageheight";N;s:11:"imageborder";N;s:17:"image_compression";N;s:13:"image_effects";N;s:12:"image_frames";N;s:6:"hidden";N;s:9:"starttime";N;s:7:"endtime";N;s:8:"fe_group";N;}', '1', '', NULL, 'Ebertstraße', '10117', 'Berlin', NULL, '', '0', '++49 30 26394336', NULL, NULL, 'Denkmal für die ermordeten Juden Europas');
INSERT INTO tx_route_marker VALUES ('6', '%pid%', '1378147722', '1368015679', '1', '0', '0', 'Berliner Fernsehturm', 'Der Berliner Fernsehturm ist mit 368 Metern das höchste Bauwerk Deutschlands und das vierthöchste freistehende Gebäude Europas. Im Jahr der Fertigstellung war er der zweithöchste Fernsehturm der Welt.', 'Der Turm im internationalen Stil wurde von Mitte bis Ende der 1960er Jahre im Zentrum Ost-Berlins errichtet und übertrifft den Berliner Funkturm in seiner Höhe deutlich. Er steht auf einer Freifläche zwischen dem Marx-Engels-Forum und dem Alexanderplatz zentral im Berliner Ortsteil Mitte und prägt als weithin sichtbare Landmarke wie auch als Wahrzeichen der Stadt die Skyline Berlins.\r\nDer Fernsehturm dient neben der Ausstrahlung von Rundfunk- und Fernsehprogrammen als Aussichtsturm und zählt mit jährlich rund 1,2 Millionen Besuchern deutschlandweit zu den beliebtesten Sehenswürdigkeiten.[2] Als politisch stark vereinnahmtes Symbol der DDR vollzog das markante und stadtprägende Bauwerk eine Wandlung zum gesamtstädtischen Symbol im wiedervereinten Berlin. Der Turm erhielt 1979 in der DDR den Denkmalstatus, der nach der Wiedervereinigung fortgeschrieben wurde.\r\n<h2>Quelle</h2>\r\n<ul><li>Der Text stammt von Wikipedia (siehe Link unten)</li></ul>', 'Fensterputzen_am_Berliner_Fernsehturm.jpg,Fernsehturm_Berlin_Eintrittskarte.jpg,Berliner_Fernsehturm.jpg', 'Fensterputzen am Fernsehturm\r\nEintrittskarte (1977)\r\nFernsehturm', 'Fensterputzen am Berliner Fernsehturm | Foto: Wladuyslaw, wikimedia.org\r\nEintrittskarte Berliner Fernsehturm von 1977\r\nBerliner Fernsehturm | Foto: Wladuyslaw, wikimedia.org\r\n', '360c', '', '1', '3', '0', '', '', '1', '0', '0', '0', '0', '52.5217974', '13.4098539', 'http://de.wikipedia.org/wiki/Fernsehturm_Berlin - - "Berliner Fernsehturm mit TYPO3 Route"', '1', '', '', '', '', '', '', '0', '0', '', '0', '0', 'a:43:{s:5:"title";N;s:5:"short";N;s:8:"bodytext";N;s:17:"tx_route_category";N;s:11:"addressname";N;s:6:"street";N;s:3:"zip";N;s:4:"city";N;s:10:"areaLevel2";N;s:10:"areaLevel1";N;s:7:"country";N;s:15:"geoupdateprompt";N;s:18:"geoupdateforbidden";N;s:3:"lon";N;s:3:"lat";N;s:5:"phone";N;s:3:"fax";N;s:5:"email";N;s:3:"url";N;s:13:"tx_route_path";N;s:10:"list_title";N;s:10:"list_short";N;s:9:"map_title";N;s:9:"map_short";N;s:5:"image";N;s:12:"imagecaption";N;s:8:"imageseo";N;s:11:"imageorient";N;s:9:"imagecols";N;s:12:"image_noRows";N;s:21:"imagecaption_position";N;s:10:"image_zoom";N;s:10:"image_link";N;s:10:"imagewidth";N;s:11:"imageheight";N;s:11:"imageborder";N;s:17:"image_compression";N;s:13:"image_effects";N;s:12:"image_frames";N;s:6:"hidden";N;s:9:"starttime";N;s:7:"endtime";N;s:8:"fe_group";N;}', '1', NULL, NULL, 'Panoramastr. 1A', '10178', 'Berlin', NULL, '* 2013-09-02 14:44:26 - Browsers - TYPO3 ohne PHP:\r\n  Breiten- und Längengrad wurden aktualisiert!\r\n* 2013-09-02 14:44:09 - Browsers - TYPO3 ohne PHP:\r\n  Breiten- und Längengrad wurden aktualisiert!\r\n* 2013-09-02 14:43:37 - Browsers - TYPO3 ohne PHP:\r\n  Breiten- und Längengrad wurden aktualisiert!\r\n\r\n', '0', '++49 30 2423333', NULL, NULL, 'Berliner Fernsehturm');
INSERT INTO tx_route_marker VALUES ('7', '%pid%', '1378126339', '1368016061', '1', '0', '0', 'Berliner Siegessäule', 'Die Siegessäule auf dem Großen Stern inmitten des Großen Tiergartens in Berlin wurde von 1864 bis 1873 als Nationaldenkmal der Einigungskriege nach einem Entwurf von Heinrich Strack erbaut. Sie steht unter Denkmalschutz.', '<h2>Erbauungsgrund</h2>\r\nAnlass zur Erbauung einer Siegessäule war der Sieg Preußens im Deutsch-Dänischen Krieg 1864. Innerhalb weniger Jahre kamen zwei weitere siegreiche Kriege hinzu, der Deutsche Krieg 1866 gegen Österreich sowie der Deutsch-Französische Krieg 1870/1871. An diese drei Siege wurde durch ihre ursprünglich drei Segmente und die krönende Bronzeskulptur der Viktoria erinnert.\r\nEingeweiht wurde die Siegessäule zur Feier des Sedantages am 2. September 1873, dem dritten Jahrestag der siegreichen Schlacht bei Sedan.\r\nDie Säule wurde 1938/1939 vom Königsplatz auf ihren heutigen Standort, den Großen Stern, versetzt.\r\nNach dem Zweiten Weltkrieg wünschte Frankreich ihre Sprengung, allerdings stimmten die anderen Alliierten nicht zu.\r\n<h2>Der Bau</h2>\r\nDer Mittelplatz des Großen Sterns kann über mehrere Fußgängertunnel unterhalb der Fahrbahn erreicht werden. Die vier – im Jahre 1941 fertiggestellten – neoklassizistischen Torhäuser bieten den Zugang zu diesem Tunnel. Die Pläne hierzu stammen von Johannes Huntemüller.<br />Die Siegessäule besteht aus einem mit poliertem, rotem Granit verkleideten Sockel und vier sich nach oben verjüngenden Säulentrommeln aus Obernkirchener Sandstein. In ihren Kannelierungen trägt sie in den unteren drei Trommeln 60 in den drei Kriegen erbeutete, vergoldete Kanonenrohre.[1] Der vierte Ring wurde nach der Umsetzung der Säule 1938/1939 hinzugefügt und seine Kannelierungen erhielten vergoldete Girlanden.\r\nIm Inneren führt eine Wendeltreppe mit 285 Stufen zur 50,66 Meter hoch gelegenen Aussichtsplattform. Von dort aus hat man einen guten Ausblick über den Großen Tiergarten, den Potsdamer Platz, das Brandenburger Tor und das umliegende Stadtgebiet. Die Gesamthöhe der Siegessäule einschließlich der Statue beträgt 66,89 Meter. Die Wiese um die Siegessäule befindet sich 34 Meter über dem Meeresspiegel (ü. NN).\r\nAuf dem Sockel befindet sich eine kreisrunde Säulenhalle mit einem Glasmosaik an der Rückwand. Nach einem von Anton von Werner geschaffenen Karton hatte es 1876 die venezianische Firma Antonio Salviati hergestellt. Bei der Einweihung war nur der Karton angebracht worden. Wie von Wilhelm I. gewünscht, stellt das Bild die Reichseinigung als Folge des Sieges über Frankreich dar.\r\n<h2>Die krönende Viktoria</h2>\r\nDie Säule trägt eine von Friedrich Drake geschaffene Bronzeskulptur in Form einer weiblichen Figur, der Viktoria. Sie hält in der Rechten einen Lorbeerkranz in die Höhe, in der Linken ein Feldzeichen mit dem Eisernen Kreuz. Ihr Helm ist mit Adlerflügeln geschmückt. Viktoria ist in der römischen Mythologie als Siegesgöttin bekannt, analog in der griechischen Mythologie die Nike. Beide werden geflügelt dargestellt. Ihr Adlerhelm lässt die Viktoria auf der Siegessäule auch als Borussia, die Personifikation Preußens, erscheinen.\r\nFriedrich Drake entwarf die Figur nach den Zügen von Victoria von Großbritannien und Irland, die zu diesem Zeitpunkt Kronprinzessin in Preußen war.[2] Hergestellt wurde die 8,30 Meter hohe und 35 Tonnen schwere Bronzefigur durch den Berliner Bildgießer Hermann Gladenbeck. Sie wurde 1954 restauriert und von der Friedenauer Bildgießerei Hermann Noack neu vergoldet. 1989 und 2011 wurde sie abermals restauriert.\r\nIm Berliner Volksmund wird die Figur „Goldelse“ genannt. Zu dieser Bezeichnung kam sie aufgrund ihrer Vergoldung und dem Titel einer gleichnamigen, damals sehr populären Fortsetzungsgeschichte in der Zeitschrift Die Gartenlaube.\r\n<h2>Quelle</h2>\r\n<ul><li>Der Text stammt von Wikipedia (siehe Link unten)</li></ul>', 'Victoria_Goldelse_Siegessaeule_Berlin.jpg,Einweihung_Siegessaeule_Berlin.jpg,Berlin_Siegessaeule.jpg', 'Victoria (Goldelse)\r\nEinweihung 1873\r\nSiegessäule Berlin\r\n', 'Victoria (Goldelse) | Foto: Lichtjäger, fotolocations.de\r\nEinweihung der Siegessäule am 2. Spetmber 1873 | Foto: unbekannt\r\nSiegessäule Berlin | Foto: Nikolai Schwerg, wikimedia.org\r\n', '', '200', '25', '1', '0', 'right', '', '1', '0', '0', '0', '0', '52.5139176', '13.3497072', 'http://de.wikipedia.org/wiki/Berliner_Siegessäule', '1', '', '', '', '', '', '', '0', '0', '', '0', '0', 'a:44:{s:5:"title";N;s:5:"short";N;s:8:"bodytext";N;s:17:"tx_route_category";N;s:7:"address";N;s:11:"addressname";N;s:6:"street";N;s:3:"zip";N;s:4:"city";N;s:10:"areaLevel2";N;s:10:"areaLevel1";N;s:7:"country";N;s:15:"geoupdateprompt";N;s:18:"geoupdateforbidden";N;s:3:"lon";N;s:3:"lat";N;s:5:"phone";N;s:3:"fax";N;s:5:"email";N;s:3:"url";N;s:13:"tx_route_path";N;s:10:"list_title";N;s:10:"list_short";N;s:9:"map_title";N;s:9:"map_short";N;s:5:"image";N;s:12:"imagecaption";N;s:8:"imageseo";N;s:11:"imageorient";N;s:9:"imagecols";N;s:12:"image_noRows";N;s:21:"imagecaption_position";N;s:10:"image_zoom";N;s:10:"image_link";N;s:10:"imagewidth";N;s:11:"imageheight";N;s:11:"imageborder";N;s:17:"image_compression";N;s:13:"image_effects";N;s:12:"image_frames";N;s:6:"hidden";N;s:9:"starttime";N;s:7:"endtime";N;s:8:"fe_group";N;}', '2', NULL, NULL, 'Großer Stern', '10557', 'Berlin', NULL, '* 2013-09-02 14:52:19 - Browsers - TYPO3 ohne PHP:\n  Breiten- und Längengrad wurden aktualisiert!\n13.350125,52.514516', '0', '++49 30 3912961', NULL, NULL, 'Siegessäule');


