INSERT INTO tx_route_path VALUES ('1', '%pid%', '1374188102', '1367158217', '1', '0', '0', 'TYPO3-Fahnen an Türme und Tore hängen', 'Du musst jeweils eine TYPO3-Fahne am Fernsehturm, am Brandenburger Tor und an der Siegessäule anbringen. Du hast 4 Stunden Zeit. Gewinner ist der, der die Fahnen am höchsten anbringt und nach der Aktion noch frei herumläuft.\r\nWir treffen uns immer am ersten Montag im Monat um 10 Uhr am Fuß des Fernsehturms.', '<h2>Fernsehturm</h2>\r\n<b>Tipp:</b> Der Fernsehturm hat einen Fahrstuhl. Bis zum Restaurant in der Kugel kannst Du ganz bequem hochfahren, Du musst keine Treppen steigen!\r\n<b>Problem:</b> Du musst die etwa acht Quadratmeter große TYPO3-Flagge außen anbringen, Fenster sind aber nicht zu öffnen.\r\n<b>Mögliche Lösung:</b> Über dem Restaurant sind Technik-Räume der Telekom. Versuche die Räume legal zu erreichen, Du kannst dann sogar am Antennenturm hochklettern. Paß auf, dass Du nicht runterfällst. Frag vielleicht vorher bei Greenpeace nach, wie man sich bei solchen Aktionen am besten sichert.\r\n<h2>Brandenburger Tor</h2>\r\n<b>Tipp 1:</b> Das Brandenburger Tor ist hohl. In den Außen-Säulen befinden sich Treppen. Die Treppen sind von den ehemaligen Wachhäuschen aus erreichbar.\r\n<b>Tipp 2:</b> Wenn Du auf dem Tor einen hohen Mast aufstellst, kannst Du Deine TYPO3-Flagge höher hängen als die anderen Wettbewerber.\r\n<b>Problem:</b> Die Türen der Wachhäuschen sind normalerweise verschlossen.\r\n<b>Mögliche Lösung:</b> Check die Schlösser! Vielleicht genügt ein einfacher Dietrich zum Aufsperren. Ansonsten bring eine lange Leiter oder eine gute Bergsteiger-Ausrüstung mit, und kletter von außen am Tor hoch.\r\n<h2>Siegessäule</h2>\r\n<b>Tipp:</b> In der Siegessäule sind Treppen. Benutze diese statt außen hochzuklettern.\r\n<b>Problem:</b> Du kannst Dich mit der TYPO3-Fahne in&nbsp;Viktoria – im Volksmund Goldelse genannt – leicht verheddern. \r\n<b>Mögliche Lösung:</b> Nimm einen Hubschrauber. Wirf die TYPO3-Fahne präpariert mit einem Ring von vier Meter Durchmessern genau über dem Kopf der Goldelse ab.\r\n<h2>Wettkampf-Bedingungen</h2>\r\nBleib ehrlich und schummel nicht! Und denk dran: Nur lebende Teilnehmer können gewinnen.\r\nGewinner werden willkürlich ermittelt und unter Ausschluß der Öffentlichkeit geehrt.', 'Berliner_Fernsehturm_01.jpg,Brandenburger_Tor_abends_02.jpg,Berlin_Siegessaeule_01.jpg', 'Fernsehturm\r\nBrandenburger Tor\r\nSiegessäule ', 'Berliner Fernsehturm | Foto: Wladuyslaw, wikimedia.org\r\nBrandenburger Tor | Foto: Thomas Wolf, www.foto-tw.de\r\nSiegessäule Berlin | Foto: Nikolai Schwerg, wikimedia.org', '', '120', '26', '1', '0', '', '', '1', '1', '0', '0', '0', '1', '#6666cc', '10', '52.52', '13.40', 'http://die-netzmacher.de - - "Die Netzzmacher – die Macher von TYPO3 Route"', '3', 'Beispiel 1: TYPO3-Flaggen an Türmen und Toren', 'Häng acht Quadratmeter große TYPO3-Flaggen an den Fernsehturm, ans Brandenburger Tor und an die Siegessäule – und zwar höher als Deine Konkurrenz!', '', '', '', '', '0', '0', '', '<b>Berliner Fernsehturm</b>\r\nPanoramastr. 1A<br />10178 Berlin\r\nTelefon: 030 2423333 ', '<b>Siegessäule</b>\r\nGroßer Stern<br />10557 Berlin\r\nTelefon: 030 3912961 ', '0', '0', 'a:37:{s:5:"title";N;s:5:"short";N;s:8:"bodytext";N;s:3:"url";N;s:7:"gpxfile";N;s:7:"geodata";N;s:17:"tx_route_category";N;s:8:"icon_lon";N;s:8:"icon_lat";N;s:15:"tx_route_marker";N;s:5:"color";N;s:10:"line_width";N;s:10:"list_title";N;s:10:"list_short";N;s:9:"map_title";N;s:9:"map_short";N;s:13:"address_start";N;s:11:"address_end";N;s:5:"image";N;s:12:"imagecaption";N;s:8:"imageseo";N;s:11:"imageorient";N;s:9:"imagecols";N;s:12:"image_noRows";N;s:21:"imagecaption_position";N;s:10:"image_zoom";N;s:10:"image_link";N;s:10:"imagewidth";N;s:11:"imageheight";N;s:11:"imageborder";N;s:17:"image_compression";N;s:13:"image_effects";N;s:12:"image_frames";N;s:6:"hidden";N;s:9:"starttime";N;s:7:"endtime";N;s:8:"fe_group";N;}', '2013.05.08_fernsehturm_siegessaeule.gpx', '13.4094708,52.5211083\r\n