INSERT INTO tx_route_path VALUES ('2', '%pid%', '1378152617', '1367163201', '1', '0', '0', 'Historische und politische Tour durch Berlin', 'Zu Fuß mit Vertretern des Bundestags vom Reichstagsgebäude zum Brandenburger Tor und zum Holocaust Mahnmal. Dauer etwa 2 Stunden.', '<h2>Reichstagsgebäude</h2>\r\nDas Reichstagsgebäude (kurz Reichstag; offiziell Plenarbereich Reichstagsgebäude) am Platz der Republik in Berlin ist seit 1999 Sitz des Deutschen Bundestages. Die Bundesversammlung tritt hier seit 1994 zur Wahl des deutschen Bundespräsidenten zusammen.\r\n<h2>Brandenburger Tor</h2>\r\nDas Brandenburger Tor markierte die Grenze zwischen Ost- und West-Berlin und damit die Grenze zwischen den Staaten des Warschauer Paktes und der NATO. Es war bis zur Wiedervereinigung Deutschlands Symbol des Kalten Krieges und wurde nach 1990 zum Symbol der Wiedervereinigung Deutschlands und Europas.\r\n<h2>Denkmal für die ermordeten Juden Europas</h2>\r\nDas Denkmal für die ermordeten Juden Europas, kurz Holocaust-Mahnmal genannt, ist ein Mahnmal für die unter der Herrschaft der Nationalsozialisten im Holocaust ermordeten Juden. Ein unterirdisches Museum (Ort der Information) ergänzt den Komplex. Es enthält unter anderem eine Liste aller Namen der bekannten jüdischen Holocaustopfer. ', 'Reichstag_Berlin_01.jpg,Brandenburger_Tor_abends_01.jpg,Holocaust-Mahnmal_Berlin_01.jpg', 'Reichstag\r\nBrandenburger Tor\r\nHolocaust Denkmal', 'Reichstag | Foto: Jürgen Matern / Wikimedia Commons, CC-BY-3.0\r\nBrandenburger Tor | Foto: Thomas Wolf, www.foto-tw.de\r\nHolocaust Denkmal | Foto: K. Weisser  / Wikimedia Commons', '', '200c', '25', '1', '0', '', '', '1', '0', '0', '0', '0', '1', '#ffcc00', '10', '52.516', '13.38', 'http://www.berlin.de/tourismus/ - - "Berliner Tourismus mit TYPO3 Route"', '3', 'Beispiel 2: Historische und politische Tour durch Berlin', 'Vom Reichstag durch das Brandenburger Tor zum Denkmal für die ermordeten Juden Europas', '', '', 'TYPO3, Route, Pfad, Beispiel, Politische Bildung', 'Veröffentliche Deine Pfade mit TYPO3 Route: Hier ein Beispiel für politische Bildung', '0', '0', '', 'Berliner Reichstag\r\nPlatz der Republik 1 <br />11011 Berlin<br />Deutschland \r\nTelefon: 030 2273 ext. 2152 ', 'Denkmal für die ermordeten Juden Europas\r\nCora-Berliner-Straße 1<br />10117 Berlin<br />Deutschland \r\nTelefon: 030 26394336 ', '0', '0', 'a:37:{s:5:"title";N;s:5:"short";N;s:8:"bodytext";N;s:3:"url";N;s:7:"gpxfile";N;s:7:"geodata";N;s:17:"tx_route_category";N;s:8:"icon_lon";N;s:8:"icon_lat";N;s:15:"tx_route_marker";N;s:5:"color";N;s:10:"line_width";N;s:10:"list_title";N;s:10:"list_short";N;s:9:"map_title";N;s:9:"map_short";N;s:13:"address_start";N;s:11:"address_end";N;s:5:"image";N;s:12:"imagecaption";N;s:8:"imageseo";N;s:11:"imageorient";N;s:9:"imagecols";N;s:12:"image_noRows";N;s:21:"imagecaption_position";N;s:10:"image_zoom";N;s:10:"image_link";N;s:10:"imagewidth";N;s:11:"imageheight";N;s:11:"imageborder";N;s:17:"image_compression";N;s:13:"image_effects";N;s:12:"image_frames";N;s:6:"hidden";N;s:9:"starttime";N;s:7:"endtime";N;s:8:"fe_group";N;}', '2013.05.08_reichstag_holocaust-mahnmal.gpx', '13.375219,52.518597\n13.375219130267086,52.51858901863587\n13.3751751,52.5185883\n13.3751698,52.5183621\n13.3751547,52.5182066\n13.3750933,52.5180494\n13.3750405,52.5179057\n13.3748911,52.5177714\n13.3747449,52.5175273\n13.3758936,52.517009\n13.376876,52.516536\n13.376803,52.5164865\n13.3767187,52.5163692\n13.3768985,52.5163547\n13.3768871,52.5163013\n13.3772052,52.5162476\n13.3776159,52.5162746\n13.377727,52.5162821\n13.3778317,52.516289\n13.3782406,52.5163161\n13.3782143,52.5164514\n13.3795905,52.5165342\n13.3804082,52.5166035\n13.3803878,52.5166789\n13.3802161,52.5166684\n13.380268436826135,52.51642909401622\n13.380236,52.516422\n13.380236,52.516422\n13.380268436826135,52.51642909401622\n13.3803169,52.5162075\n13.3804963,52.5162229\n13.3804725,52.5163255\n13.3808446,52.516345\n13.3809253,52.5161934\n13.3814483,52.5152134\n13.3814876,52.5151408\n